import React from "react";
import styles from "./filter.module.css";

const Filter = ({ searchContact, value }) => {
  return (
    <div className={styles.block}>
      <input
        type="text"
        onChange={searchContact}
        placeholder="search"
        value={value}
      />
    </div>
  );
};

export default Filter;
